import React from 'react';
import DarkModeIcon from '@mui/icons-material/DarkMode';

const TopNavbar = () => {
  return (
    <div>
        <h3>Where in the world?</h3>
        <div>
            <DarkModeIcon/>
            <p>Dark Mode</p>
        </div>
    </div>
  )
}

export default TopNavbar
